import React from 'react'
import spinner from '../assets/spinner.svg'

export default function Loader() {
    const loaderStyle = {
        height: "100vh",
        width: "100%",
        display: "flex",
        justifyContent: "center",
        alignItems: "center",
        background: "#131313",
        color: "white"
    }

    return (
        <div style={loaderStyle}>
            {spinner}
        </div>
    )
}
